import styled from 'styled-components';

export const Container = styled.div`

display: block;
#myCart{
    display: flex;
    height: auto;
    flex-direction: column;
    align-items: flex-start;
}
h1 {
    margin-top: 2%;
    min-width: 100%;
    text-align: center;
    margin-left: 2%;
}
.productList{
    width: 70%;
}
`;
